import React from 'react'
import { Modal } from 'react-bootstrap';

const ProductViewModal = ({show, onHide}) => {
  return (
    <>
     <Modal show={show} onHide={onHide}>
        <Modal.Body>
         <div className="product-quick-view">
            
         </div>
        </Modal.Body>
     </Modal>
    </>
  )
}

export default ProductViewModal;
